import{_ as a,a as r,b as e,c as l,d as t,e as o,f as i,g as s,h as p,i as h,j as n,k as c,l as m,m as _,n as u,o as b,p as f,q as g,r as d,s as k,t as y,u as x,v as P,w as q,x as M}from"./chunks/payloads_x500v2.R6joOXSR.js";import{_ as v}from"./chunks/x500v2_airframe_qgc.DnZb3Qf9.js";import{_ as w,c as A,o as C,ab as S}from"./chunks/framework.CUflZczI.js";const J=JSON.parse('{"title":"Holybro X500 V2 + Pixhawk 6C (PX4 Dev Kit)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/holybro_x500v2_pixhawk6c.md","filePath":"uk/frames_multicopter/holybro_x500v2_pixhawk6c.md"}'),X={name:"uk/frames_multicopter/holybro_x500v2_pixhawk6c.md"},I=S('<h1 id="holybro-x500-v2-pixhawk-6c-px4-dev-kit" tabindex="-1">Holybro X500 V2 + Pixhawk 6C (PX4 Dev Kit) <a class="header-anchor" href="#holybro-x500-v2-pixhawk-6c-px4-dev-kit" aria-label="Permalink to &quot;Holybro X500 V2 + Pixhawk 6C (PX4 Dev Kit)&quot;">​</a></h1><p>Ця тема надає повні інструкції для збирання <a href="https://holybro.com/collections/x500-kits" target="_blank" rel="noreferrer">Комплекту Holybro X500 V2 ARF</a>, також відомого як Holybro PX4 Dev Kit.</p><p><img src="'+a+'" alt="The fully built vehicle with props removed"></p><h2 id="збірка" tabindex="-1">Збірка <a class="header-anchor" href="#збірка" aria-label="Permalink to &quot;Збірка&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Зображення в цьому документі можна вибрати, щоб переглянути відео на youtube крок за кроком.</li><li>Кожний розділ перелічує всі необхідні гвинти у верхній частині.</li></ul></div><h3 id="навантаження-та-тримач-батареі" tabindex="-1">Навантаження та тримач батареї <a class="header-anchor" href="#навантаження-та-тримач-батареі" aria-label="Permalink to &quot;Навантаження та тримач батареї&quot;">​</a></h3><p><strong>Саморіз</strong>- Закріпний винт M2.5*6 12шт</p><ol><li><p>Вставте резинове кільце підвіски-висувки в кожну з їхніх відповідних підвісок. Не використовуйте гострi предмети для натискання резинок всередині.</p><p><a href="https://www.youtube.com/watch?v=4Tid-FCP_aI" target="_blank" rel="noreferrer"><img src="'+r+'" alt="Assembly1"></a></p></li><li><p>Візьміть плату кріплення батареї і закрутіть її за допомогою затискача зі слайдом за допомогою відвірки винта M2.5*6.</p><p><a href="https://youtu.be/9E-rld6tPWQ" target="_blank" rel="noreferrer"><img src="'+e+'" alt="Assembly2"></a></p></li><li><p>Закрутіть 4 вішалки на дошку платформи, використовуючи поглиблену винт M2.5*6.</p><p><a href="https://youtu.be/4qIBABc9KsY" target="_blank" rel="noreferrer"><img src="'+l+'" alt="Assembly3"></a>)</p></li><li><p>Візьміть зациклювальну планку та вставте 4 вісця, щоб прикрутити до нижньої плати пізніше.</p><p><a href="https://youtu.be/CFx6Ct7FCIc" target="_blank" rel="noreferrer"><img src="'+t+'" alt="Assembly4"></a>)</p></li><li><p>Зараз вставте тримач батареї та тримачі навантаження, зібрані на кроці 2 &amp; 3</p></li></ol><h3 id="модуль-живлення" tabindex="-1">Модуль живлення <a class="header-anchor" href="#модуль-живлення" aria-label="Permalink to &quot;Модуль живлення&quot;">​</a></h3><p><strong>Шуруп</strong>- Шуруп з шестигранною головкою M2.5<em>6 8шт | Гайка M3 4шт | Нейлонова опора M3</em>5 4шт | Шуруп M3*14 4шт</p><p><a href="https://youtu.be/0knU3Q_opEo" target="_blank" rel="noreferrer"><img src="'+o+'" alt="Assembly5"></a>)</p><ol><li><p>Візьміть нижню пластину і вставте 4 гвинти M3*14 та закрутіть нейлонові заглушки на них.</p><p><a href="https://youtu.be/IfsMXTr3Uy4" target="_blank" rel="noreferrer"><img src="'+i+'" alt="Assembly6"></a></p></li><li><p>Розмістіть Планку розподілу живлення та використовуйте гайки-самостопорювачі для їх збирання. Модуль живлення PM02 (для Pixhawk 6C) буде живити цю плату</p><p><a href="https://youtu.be/Qjs6pqarRIY" target="_blank" rel="noreferrer"><img src="'+s+'" alt="Assembly7"></a></p></li><li><p>Використовуйте винти гніздові з головкою M2.5*6 та закрутіть нижню пластину на 4 вісці (які ми вставили в 2 планки на 3-му кроці збірки тримача навантаження)### Шасі</p></li><li><p>Для збирання станції шасі відкрутіть заздалегідь складені винти шасі - перекрестна стрічка та вставте шасі - вертикальний стовп і затягніть той же.</p><p><a href="https://youtu.be/mU4vm4zyjcY" target="_blank" rel="noreferrer"><img src="'+p+'" alt="Assembly8"></a></p><p><a href="https://youtu.be/7REaF3YAqLg" target="_blank" rel="noreferrer"><img src="'+h+'" alt="Assembly9"></a></p></li><li><p>Використовуйте Гвинт кришки розетки M3*8, щоб прикрутити посадкові шасі до нижньої пластини</p><p><a href="https://youtu.be/iDxzWeyCN54" target="_blank" rel="noreferrer"><img src="'+n+'" alt="Assembly11"></a></p><p><a href="https://youtu.be/3fNJQraCJx0" target="_blank" rel="noreferrer"><img src="'+c+'" alt="Assembly12"></a></p></li></ol><p>Оскільки важко вставити проводи після того, як верхня плита складена, зробіть проводку заздалегідь. Хоча дизайн добре спроектований таким чином, що ви зможете зробити це пізніше також.</p><p><a href="https://youtu.be/3en4DlQF4XU" target="_blank" rel="noreferrer"><img src="'+m+'" alt="Assembly13"></a></p><h3 id="потужність" tabindex="-1">Потужність <a class="header-anchor" href="#потужність" aria-label="Permalink to &quot;Потужність&quot;">​</a></h3><p>Pixhawk 6C запитується за допомогою плати живлення PM02 (у цьому випадку). Цей модуль живлення постачається від батареї (4S 16.8V 5200 мАг)</p><p>Двигуни живляться через розподільчу дошку живлення, як показано на наведеній нижче схемі.</p><p><img src="'+_+'" alt="motors_pdb_pixhawk6c"></p><p>Зверніть увагу, що роз&#39;єми ESC мають кольорову кодировку і повинні бути вставлені в PWM out так, що білий кабель зверху.</p><p><img src="'+u+'" alt="esc_connector_pixhawk6c"></p><h3 id="зброя" tabindex="-1">Зброя <a class="header-anchor" href="#зброя" aria-label="Permalink to &quot;Зброя&quot;">​</a></h3><p><strong>Винт-</strong> болт з гніздовою головкою M3*38 16шт | Фланцева гайка M3 16шт</p><p><a href="https://youtu.be/66Hfy6ysOpg" target="_blank" rel="noreferrer"><img src="'+b+'" alt="Assembly14"></a></p><ol><li><p>Поставити руки досить просто, оскільки двигуни поставляються вже зібраними.</p><ul><li>Переконайтесь, що у вас є правильна пронумерована рука з мотором на відповідному боці.</li></ul><p><a href="https://youtu.be/45KCey3WiJ4" target="_blank" rel="noreferrer"><img src="'+f+'" alt="Assembly15"></a></p><div class="tip custom-block"><p class="custom-block-title">TIP</p></div></li></ol><p>Використовуйте свої ключі аллен / будь-який витягнутий предмет і вставте його на протилежний бік болта, який ви намагаєтеся закрутити. :::</p><ol><li><p>Возьміть одну руку та вставте прямокутний виступ всередину прямокутного порожнини на нижній плиті.</p><p><a href="https://youtu.be/GOTqmjq9_3s" target="_blank" rel="noreferrer"><img src="'+g+'" alt="Assembly16"></a></p></li><li><p>Під час встановлення верхньої пластини поверх цієї 3-шарової конструкції (нижня пластина, верхня пластина і плечі) необхідно закрутити гвинтом з шестигранною головкою M3*38 та гайкою з фланцем M3.</p></li><li><p>Утримуйте одну сторону, використовуючи міні-гайковий ключ, який надається у розробницькому комплекті.</p><p><a href="https://youtu.be/2rcNVekJQd0" target="_blank" rel="noreferrer"><img src="'+d+'" alt="Assembly17"></a></p></li><li><p>Не зав&#39;язуйте жодних болтів, поки всі 3 мотори не будуть на місці, оскільки це може зробити складним збирання 3-го та 4-го моторів.</p><p><a href="https://youtu.be/SlKRuNoE_AY" target="_blank" rel="noreferrer"><img src="'+k+'" alt="Assembly18"></a></p></li></ol><h3 id="пропелери" tabindex="-1">Пропелери <a class="header-anchor" href="#пропелери" aria-label="Permalink to &quot;Пропелери&quot;">​</a></h3><p><a href="https://youtu.be/yu75VkMaIyc" target="_blank" rel="noreferrer"><img src="'+y+'" alt="Assembly19"></a></p><ul><li>Нижня пластина вказує напрямок двигуна.</li><li>Пропелери, які мають біле/сріблясте покриття, йдуть на відповідний двигун із подібним покриттям.</li><li>Розблокування та блокування пропелера вказано на самому пропелері.</li><li>Використовуйте 4 пропелери та вставте їх у мотори, пам’ятаючи про 3 пункти вище.</li></ul><p>Наступні частини можна розмістити, як завжди.</p><h3 id="gps" tabindex="-1">GPS <a class="header-anchor" href="#gps" aria-label="Permalink to &quot;GPS&quot;">​</a></h3><p><strong>Гвинт-</strong> гайка M3 4 шт | Гвинт М3*10 4шт</p><ol><li><p>Зберіть GPS, дотримуючись відео.</p><p><a href="https://youtu.be/aiFxVJFjlos" target="_blank" rel="noreferrer"><img src="'+x+'" alt="Assembly20"></a></p><p>У цьому посібнику використовується місце кріплення GPS, запропоноване в посібнику Holybro.</p></li><li><p>Прикрутіть нижній кінець кріплення GPS до тримача корисного навантаження за допомогою гайки M3 та гвинта М3*10</p><p><a href="https://youtu.be/uG5UKy3FrIc" target="_blank" rel="noreferrer"><img src="'+P+'" alt="Assembly21"></a></p></li></ol><h3 id="pixhawk-6c" tabindex="-1">Pixhawk 6C <a class="header-anchor" href="#pixhawk-6c" aria-label="Permalink to &quot;Pixhawk 6C&quot;">​</a></h3><ul><li>Дріт від PM02 йде до POWER1 в Pixhawk</li><li>Телеметрія йде на TELEM1</li><li>GPS до GPS1</li></ul><p><a href="https://youtu.be/wFlr_I3jERQ" target="_blank" rel="noreferrer"><img src="'+q+'" alt="Assembly22"></a></p><h3 id="супутніи-комп-ютер-необов-язково" tabindex="-1">Супутній комп&#39;ютер (необов&#39;язково) <a class="header-anchor" href="#супутніи-комп-ютер-необов-язково" aria-label="Permalink to &quot;Супутній комп&#39;ютер (необов&#39;язково)&quot;">​</a></h3><p><strong>Гвинт-</strong> Socket Cap Screw M2.5<em>12 4pcs | Nylon Standoff M2.5</em>5 4pcs Locknut M2.5 4pcs</p><p>Набір X500 забезпечує місце для супутнього комп&#39;ютера, такого як Raspberry Pi або Jetson nano, що можуть бути розміщені тут [TBD].</p><ul><li>Вставте 4 гвинти з головкою M2.5*12 та поставте штифти на те ж саме місце.</li><li>Тепер розмістіть супутній комп&#39;ютер і змонтуйте його, використовуючи гайку з фіксацією M2.5</li></ul><h3 id="камера" tabindex="-1">Камера <a class="header-anchor" href="#камера" aria-label="Permalink to &quot;Камера&quot;">​</a></h3><ul><li>Камери, такі як камера глибини / відстеження Intel Realsense або Structure Core, можна встановити за допомогою кріплення для Depth Camera</li><li>Просто вставте кріплення всередину 2-х планок і використовуйте гвинти залежно від камери, яку ви використовуєте.</li></ul><p><img src="'+M+'" alt="payloads_x500v2"></p><h2 id="встановлення-налаштування-px4" tabindex="-1">Встановлення/Налаштування PX4 <a class="header-anchor" href="#встановлення-налаштування-px4" aria-label="Permalink to &quot;Встановлення/Налаштування PX4&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Повні інструкції щодо встановлення та налаштування PX4 можна знайти в <a href="./../config/">Базова конфігурація</a>.</p></div><p><em>QGroundControl</em> використовується для встановлення автопілота PX4 та його налаштування / відладки для рами X500. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Завантажте та встановіть</a> <em>QGroundControl</em> для вашої платформи.</p><p>Спочатку оновіть прошивку, раму та зіставлення актуаторів:</p><ul><li><p><a href="./../config/firmware.html">Прошивка</a></p></li><li><p><a href="./../config/airframe.html">Рама</a></p><p>Вам потрібно буде вибрати раму <em>Holybro X500 V2</em> (<strong>Квадрокоптер x &gt; Holybro 500 V2</strong>)</p><p><img src="'+v+'" alt="QGroundControl - Select HolyBro 500 airframe"></p></li><li><p><a href="./../config/actuators.html">Актуатори</a></p><ul><li>Вам не потрібно оновлювати геометрію апарту (оскільки це попередньо сконфігурована рама).</li><li>Призначте функції приводу до актуаторів, щоб відповідати вашому підключенню. Рама попередньо налаштована з моторами на <strong>FMU PWM Out</strong>.</li><li>Перевірте конфігурацію, використовуючи слайдери.</li></ul></li></ul><p>Потім виконайте обов&#39;язкове налаштування / калібрування:</p><ul><li><a href="./../config/flight_controller_orientation.html">Орієнтація сенсора</a></li><li><a href="./../config/compass.html">Компас</a></li><li><a href="./../config/accelerometer.html">Акселерометр</a></li><li><a href="./../config/level_horizon_calibration.html">Калібрування рівня горизонту</a></li><li><a href="./../config/radio.html">Налаштування радіо</a></li><li><a href="./../config/flight_mode.html">Режими польоту</a></li></ul><p>В ідеалі ви також повинні зробити:</p><ul><li><a href="./../advanced_config/esc_calibration.html">Калібрування ESC</a></li><li><a href="./../config/battery.html">Регулювання оцінки заряду акумулятора</a></li><li><a href="./../config/safety.html">Загальна безпека</a></li></ul><h2 id="вдосконалення" tabindex="-1">Вдосконалення <a class="header-anchor" href="#вдосконалення" aria-label="Permalink to &quot;Вдосконалення&quot;">​</a></h2><p>Вибір рами встановлює параметри автопілота <em>за замовчуванням</em> для рами. Вони достатньо хороші для польоту, але гарною ідеєю є тюнінг параметрів для конкретної конструкції рами.</p><p>Для інструкцій щодо того, як розпочати, почніть з <a href="./../config/autotune.html">Авто тюнінг</a>.</p><h2 id="подяки" tabindex="-1">Подяки <a class="header-anchor" href="#подяки" aria-label="Permalink to &quot;Подяки&quot;">​</a></h2><p>Цей журнал збірки був наданий Акшата та Хамішем Віллі з великими подяками компанії Holybro та Dronecode за апаратне забезпечення та технічну підтримку.</p>',57),T=[I];function V(E,F,G,D,H,Q){return C(),A("div",null,T)}const j=w(X,[["render",V]]);export{J as __pageData,j as default};
